backpipe enables decorator on R #rstats
backpipe使えばRでも簡単にデコレータを実現できるね。

library(backpipe)
library(magrittr)

add_msg = function(f, msg) {
  function(...) {
    message(msg)  
    f(...)
  }
}

add = add_msg("Sum is ...") %&lt;%
  function(x, y) x + y
add(1, 1) https://t.co/PNTwDsGLbX

